from collections import Counter

class Solution:
    def minDeletions(self, s: str) -> int:
        cntr = Counter(s)
        used_frequencies = set()
        deletions = 0
        for _, freq in cntr.items():
            while freq > 0 and freq in used_frequencies:
                freq -= 1
                deletions += 1
            used_frequencies.add(freq)
        return deletions

